    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,143.19,607.16)"
       style="font-variant:normal;font-size:10.5px;font-family:'MS Outlook';-inkscape-font-specification:MSung-Light-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text540"><tspan
         x="0 11.6004 23.2008 34.801201"
         y="0"
         id="tspan530">敬启者：</tspan><tspan
         x="22.710449 33.845699 44.980949 56.116199 67.25145 78.386703 89.52195 100.6572 111.79245 122.9277 134.06294 145.1982 152.10091 158.01135 168.1218 179.22134 190.35135 200.46181 206.3712 213.27075 224.40601 235.54124 246.6765 257.81174 268.94699 275.91061 285.96014 297.12061 308.25061 319.35016 330.51059 337.47104 347.5206 358.6506 369.81104 379.8606 385.77106 392.70105 403.86151 414.96106 426.12149"
         y="23.999849"
         id="tspan532">吾等根据腾讯控股有限公司（「贵公司」）及其附属公司（以下统称为「贵集团」）的指示，</tspan><tspan
         x="0.00105 11.46495 22.92885 34.39275 45.856651 57.320549 68.784447 80.248352 91.71225 103.17615 114.64005 126.10395 137.56786 149.03175 160.49565 171.95955 179.25075 185.46045 195.84074 207.30045 217.7406 223.9503 231.21001 242.66341 254.18295 265.63635 277.08975 288.54315 299.99655 311.44995 322.90335 334.42291 345.85321 357.30661 368.76001 380.21341 391.66681 403.12021 414.63974 426.07004"
         y="40.019699"
         id="tspan534">对贵集团成员公司在中华人民共和国（「中国」）所持的全部物业权益进行估值。吾等确认</tspan><tspan
         x="0 11.5164 23.032801 34.549198 46.065601 57.582001 69.098396 80.614799 92.131203 103.6476 115.164 126.6804 138.19679 149.7132 161.2296 172.746 184.26241 195.77879 207.2952 218.8116 230.328 241.84441 253.36079 264.8772 276.39359 287.91 299.42639 310.94281 322.4592 333.97559 345.492 357.00839 368.52481 380.0412 391.55759 403.07401 414.59039 426.10681"
         y="56.010151"
         id="tspan536">曾进行实地视察、作出有关查询，以及取得吾等认为必需的其他资料，以就该等物业权</tspan><tspan
         x="0 11.60355 23.2071 34.81065 46.360649 57.964199 69.567749 81.171303 92.774849 104.3784 115.98195 127.53195 139.1355 146.4897 152.84955 163.40939 174.98985 186.53986 198.1497 208.70955 215.03999 222.44984 234.04919 245.64854 257.19855 268.79791 280.39725 291.99661 303.59595 315.19531 326.79465 338.34464 349.944 361.54333 373.1427"
         y="72.000603"
         id="tspan538">益于二零零四年三月三十一日（「估值日期」）的价值向阁下提供吾等的意见。</tspan></text>

         y="0"
         id="tspan546">吾等对物业权益的估值乃指公开市值。所谓公开市值，就吾等所下定义而言，乃指</tspan><tspan
         x="-26.91045 -16.350599 -4.7701502 6.77985 18.3813 29.98275 41.584202 53.18565 64.787102 76.337097 87.938553 99.540001 111.14145 122.7429 134.34435 145.89435 157.4958 169.09724 180.6987 192.30016 203.9016 215.4516 227.05305 238.6545 250.25595 261.85739 273.45886 285.00885 296.61029 308.21176 319.8132 331.41464 343.01611 354.5661 366.16754 377.76901 389.37045"
         y="15.99045"
         id="tspan548">「物业权益于估值当日在下列假定情况下无条件完成出售而可取得的最高现金代价：</tspan></text>

             id="text48"><tspan
               x="0 11.6004 23.2008 34.750801 46.3512 57.951599 69.552002 81.152397 92.7528 104.3028 115.9032 127.5036 139.104 150.70441 162.30479 173.8548 185.4552 197.0556 207.61545"
               y="0"
               id="tspan46">双方均在知情及自愿的情况下审慎交易。」</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,143.19,723.05)"
             style="font-variant:normal;font-size:11.5px;font-family:MHei-Bold-Identity;-inkscape-font-specification:MHei-Bold-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text52"><tspan
               x="0 12.66725 25.334499 38.001751"
               y="0"
               id="tspan50">估值方法</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,165.9,699.05)"
             style="font-variant:normal;font-size:10.5px;font-family:'MS Outlook';-inkscape-font-specification:MSung-Light-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text60"><tspan
               x="0 11.52585 23.051701 34.577549 46.103401 57.62925 69.155098 80.680946 92.206802 103.73265 115.2585 126.78435 138.3102 149.83604 161.36189 172.88776 184.4136 195.93945 207.4653 218.99115 230.517 242.04285 253.5687 265.09454 276.62039 288.14624 299.67209 311.19794 322.72379 334.24966 345.77551 357.30136 368.82721 380.35306 391.87891 403.40475"
               y="0"
               id="tspan54">根据上述公开市值计算法，由于不得于公开市场转让或租约及或租赁协议订明不</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="15.99045"
               id="tspan56">得分租及或转让或缺乏可观租金收入，故此吾等认为贵集团所租用及占用的物业权益</tspan><tspan
               x="-22.710449 -11.11845 0.47354999 12.06555 23.657551 35.24955 46.841549"
               y="32.0103"
               id="tspan58">并无商业价值。</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,143.19,635.06)"
             style="font-variant:normal;font-size:11.5px;font-family:MHei-Bold-Identity;-inkscape-font-specification:MHei-Bold-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text64"><tspan
               x="0 12.65"
               y="0"
               id="tspan62">假设</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,165.9,611.06)"
             style="font-variant:normal;font-size:10.5px;font-family:'MS Outlook';-inkscape-font-specification:MSung-Light-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text94"><tspan
               x="0 11.2056 22.4112 33.616798 44.822399 56.028 67.233597 78.439201 89.644798 100.8504 112.056 123.2616 134.46719 145.67281 156.8784 168.084 179.2896 190.49519 201.70081 212.9064 224.112 235.3176 246.52319 257.72879 268.93439 280.14001 291.34561 302.55121 313.75681 324.9624 336.168 347.3736 358.57919 369.78479 380.99039 392.19601 403.40161"
               y="0"
               id="tspan66">吾等的估值乃假设业主在公开市场出售物业权益而无凭借递延条款合约、售后租回、</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="16.01985"
               id="tspan68">合资经营、管理协议或任何类似安排以擡高物业权益的价格。此外，吾等的估值假设并</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="32.0103"
               id="tspan70">无任何形式的强制出售情况。除另有注明者外，吾等亦假设该等物业权益可于所获授的</tspan><tspan
               x="-22.710449 -11.11845 0.47354999 12.06555 23.657551 35.24955 46.841549 58.433552 70.025551 81.617554 93.209549 104.80155 116.39355 127.98555 139.57755 151.16956 162.76155 174.35355 185.94556 197.53755 209.12955 220.72156 232.31355 243.90555 255.49754 267.08954 278.68155 290.27356 301.86554 313.45755 325.04956"
               y="48.000751"
               id="tspan72">整个未届满年期内在公开市场出售及转让而毋须承担任何费用或开支。</tspan><tspan
               x="0 11.52585 23.051701 34.577549 46.103401 57.62925 69.155098 80.680946 92.206802 103.73265 115.2585 126.78435 138.3102 149.83604 161.36189 172.88776 184.4136 195.93945 207.4653 218.99115 230.517 242.04285 253.5687 265.09454 276.62039 288.14624 299.67209 311.19794 322.72379 334.24966 345.77551 357.30136 368.82721 380.35306 391.87891 403.40475"
               y="72.000603"
               id="tspan74">吾等的估值并无考虑物业权益的任何抵押、按揭或欠款，亦无考虑在出售成交时可</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="88.020447"
               id="tspan76">能承担的任何开支或税项。除另有说明外，吾等假设全部物业权益概无涉及任何可影响</tspan><tspan
               x="-22.710449 -11.11845 0.47354999 12.06555 23.657551 35.24955 46.841549 58.433552 70.025551 81.617554 93.209549 104.80155 116.39355 127.98555"
               y="104.0109"
               id="tspan78">价值的繁重负担、限制及支销。</tspan><tspan
               x="0 11.52585 23.051701 34.577549 46.103401 57.62925 69.155098 80.680946 92.206802 103.73265 115.2585 126.78435 138.3102 149.83604 161.36189 172.88776 184.4136 195.93945 207.4653 218.99115 230.517 242.04285 253.5687 265.09454 276.62039 288.14624 299.67209 311.19794 322.72379 334.24966 345.77551 357.30136 368.82721 380.35306 391.87891 403.40475"
               y="128.01076"
               id="tspan80">吾等假设有关政府机关已就已落成或在建中楼宇及建筑物授出所有同意书、批文及</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="144.00121"
               id="tspan82">特许权。此外，除另有注明者外，吾等假设建于该地盘的所有楼宇及建筑物由业主持有</tspan><tspan
               x="-22.710449 -11.1174 0.47565001 12.0687 23.661751 35.254799 46.847851 58.440899"
               y="160.02106"
               id="tspan84">或容许业主占用。</tspan><tspan
               x="0 11.52585 23.051701 34.577549 46.103401 57.62925 69.155098 80.680946 92.206802 103.73265 115.2585 126.78435 138.3102 149.83604 161.36189 172.88776 184.4136 195.93945 207.4653 218.99115 230.517 242.04285 253.5687 265.09454 276.62039 288.14624 299.67209 311.19794 322.72379 334.24966 345.77551 357.30136 368.82721 380.35306 391.87891 403.40475"
               y="184.0209"
               id="tspan86">吾等假设除非已于估值证书内列明、界定及考虑不合标准的事宜，否则所有适用的</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="200.01135"
               id="tspan88">分区、土地使用法规及其他限制一直贯彻采用。此外，吾等亦假设土地使用及改善工程</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="216.0018"
               id="tspan90">均于所述物业权益的范围内进行，且除估值证书另有注明外，亦无出现据用或侵占的情</tspan><tspan
               x="-22.710449 -11.11005"
               y="232.02165"
               id="tspan92">况。</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,143.19,347.06)"
             style="font-variant:normal;font-size:11.5px;font-family:MHei-Bold-Identity;-inkscape-font-specification:MHei-Bold-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text98"><tspan
               x="0 12.6615 25.323 37.984501 50.646 63.307499 75.969002 88.630501 101.292 113.9535"
               y="0"
               id="tspan96">所有权及租赁权益调查</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,165.9,323.06)"
             style="font-variant:normal;font-size:10.5px;font-family:'MS Outlook';-inkscape-font-specification:MSung-Light-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text106"><tspan
               x="0 11.2056 22.4112 33.616798 44.822399 56.028 67.233597 78.439201 89.644798 100.8504 112.056 123.2616 134.46719 145.67281 156.8784 168.084 179.2896 190.49519 201.70081 212.9064 224.112 235.3176 246.52319 257.72879 268.93439 280.14001 291.34561 302.55121 313.75681 324.9624 336.168 347.3736 358.57919 369.78479 380.99039 392.19601 403.40161"
               y="0"
               id="tspan100">吾等曾获有关物业权益的所有权及贵集团所订立的所有租赁协议的文件摘要。然而，</tspan><tspan
               x="-22.710449 -11.4975 -0.28455001 10.9284 22.14135 33.354301 44.567249 55.780201 66.993149 78.2061 89.419052 100.632 111.84495 123.0579 134.27084 145.4838 156.69675 167.9097 179.12265 190.3356 201.54855 212.76151 223.97446 235.18739 246.40034 257.61331 268.82626 280.03922 291.25214 302.46509 313.67804 324.89099 336.10394 347.31689 358.52985 369.7428 380.95575 392.1687 403.38165"
               y="16.01985"
               id="tspan102">吾等并无查阅文件正本，以核实拥有权或是否存在任何未载于吾等所获副本的任何修订。</tspan><tspan
               x="-22.710449 -11.1195 0.47145 12.0624 23.653351 35.244301 46.835251 58.426201 70.017151 81.608101 93.199051 104.79 116.38095 127.9719 139.56285 151.15379 162.74475 174.33569"
               y="32.0103"
               id="tspan104">吾等颇大程度倚赖贵集团所提供的资料。</tspan></text>

          <text

             id="text42"><tspan

               y="0"
               id="tspan34">本函件所披露的所有法律文件及估值证书仅供参考。吾等对任何有关本函件及估值</tspan><tspan
               x="-22.710449 -11.1174 0.47565001 12.0687 23.661751 35.254799 46.847851 58.440899 70.033951 81.626999 93.220047 104.8131 116.40615 127.9992 139.59225 151.1853 162.77835 174.3714 185.96445 197.5575 209.15054 220.74361 232.33665 243.9297 255.52275 267.11581 278.70886 290.30191"
               y="16.01985"
               id="tspan36">证书所述物业权益的合法所有权的法律事宜概不承担任何责任。</tspan><tspan
               x="0 11.52585 23.051701 34.577549 46.103401 57.62925 69.155098 80.680946 92.206802 103.73265 115.2585 126.78435 138.3102 149.83604 161.36189 172.88776 184.4136 195.93945 207.4653 218.99115 230.517 242.04285 253.5687 265.09454 276.62039 288.14624 299.67209 311.19794 322.72379 334.24966 345.77551 357.30136 368.82721 380.35306 391.87891 403.40475"
               y="40.019699"
               id="tspan38">对于贵集团在中国所持物业权益的合法所有权及租赁权益的合法性，吾等倚赖中伦</tspan><tspan
               x="-22.710449 -11.1174 0.47565001 12.0687 23.661751 35.254799 46.847851 58.440899 70.033951 81.626999 93.220047 104.8131 116.40615 127.9992 139.59225 151.1853"
               y="56.010151"
               id="tspan40">金通律师事务所所提供的法律意见。</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,143.19,691.04)"
             style="font-variant:normal;font-size:11.5px;font-family:MHei-Bold-Identity;-inkscape-font-specification:MHei-Bold-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text46"><tspan
               x="0 12.66725 25.334499 38.001751"
               y="0"
               id="tspan44">限制条件</tspan></text>
          <text
             xml:space="preserve"
             transform="matrix(1,0,0,-1,165.9,667.04)"
             style="font-variant:normal;font-size:10.5px;font-family:'MS Outlook';-inkscape-font-specification:MSung-Light-Identity-H;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
             id="text72"><tspan
               x="0 11.2056 22.4112 33.616798 44.822399 56.028 67.233597 78.439201 89.644798 100.8504 112.056 123.2616 134.46719 145.67281 156.8784 168.084 179.2896 190.49519 201.70081 212.9064 224.112 235.3176 246.52319 257.72879 268.93439 280.14001 291.34561 302.55121 313.75681 324.9624 336.168 347.3736 358.57919 369.78479 380.99039 392.19601 403.40161"
               y="0"
               id="tspan48">吾等在颇大程度上倚赖贵集团所提供的资料，并接纳贵集团给予吾等有关法定通告、</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="15.99045"
               id="tspan50">地役权、年期、占用情况、地盘与楼面面积及一切其他相关资料。估值证书所列的尺寸</tspan><tspan
               x="-22.710449 -11.11845 0.47354999 12.06555 23.657551 35.24955 46.841549 58.433552 70.025551 81.617554 93.209549 104.80155 116.39355 127.98555 139.57755 151.16956 162.76155 174.35355 185.94556 197.53755 209.12955 220.72156 232.31355 243.90555"
               y="31.9809"
               id="tspan52">及面积乃根据吾等所获文件的资料计算，且仅为约数。</tspan><tspan
               x="0 11.52585 23.051701 34.577549 46.103401 57.62925 69.155098 80.680946 92.206802 103.73265 115.2585 126.78435 138.3102 149.83604 161.36189 172.88776 184.4136 195.93945 207.4653 218.99115 230.517 242.04285 253.5687 265.09454 276.62039 288.14624 299.67209 311.19794 322.72379 334.24966 345.77551 357.30136 368.82721 380.35306 391.87891 403.40475"
               y="55.980751"
               id="tspan54">吾等并无理由怀疑贵集团所提供资料的真实性及准确性。贵集团亦向吾等表示所提</tspan><tspan
               x="-22.710449 -11.1174 0.47565001 12.0687 23.661751 35.254799 46.847851 58.440899 70.033951 81.626999 93.220047 104.8131 116.40615 127.9992 139.59225 151.1853 162.77835 174.3714 185.96445 197.5575 209.15054 220.74361 232.33665 243.9297 255.52275 267.11581 278.70886 290.30191 301.89496 313.48801 325.08105 336.6741 348.26715 359.8602"
               y="72.000603"
               id="tspan56">供资料并无遗漏任何重大事实。吾等认为已获充份资料，以达致知情的观点。</tspan><tspan
               x="0 11.2056 22.4112 33.616798 44.822399 56.028 67.233597 78.439201 89.644798 100.8504 112.056 123.2616 134.46719 145.67281 156.8784 168.084 179.2896 190.49519 201.70081 212.9064 224.112 235.3176 246.52319 257.72879 268.93439 280.14001 291.34561 302.55121 313.75681 324.9624 336.168 347.3736 358.57919 369.78479 380.99039 392.19601 403.40161"
               y="96.00045"
               id="tspan58">吾等已视察随附估值证书所载物业权益的外貌，并在许可情况下视察其内部。然而，</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="111.9909"
               id="tspan60">吾等并无进行任何结构测量，故此无法呈报有关物业权益是否确无腐朽、虫蛀或任何其</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="127.98135"
               id="tspan62">他结构损坏。吾等并无对任何设施进行测试，惟吾等在视察过程中亦无发现任何严重损</tspan><tspan
               x="-22.710449 -11.11005"
               y="144.00121"
               id="tspan64">坏。</tspan><tspan
               x="0 11.52585 23.051701 34.577549 46.103401 57.62925 69.155098 80.680946 92.206802 103.73265 115.2585 126.78435 138.3102 149.83604 161.36189 172.88776 184.4136 195.93945 207.4653 218.99115 230.517 242.04285 253.5687 265.09454 276.62039 288.14624 299.67209 311.19794 322.72379 334.24966 345.77551 357.30136 368.82721 380.35306 391.87891 403.40475"
               y="168.00105"
               id="tspan66">吾等并无进行实地调查，以核实土地状况及设施是否适合建议发展项目，亦无进行</tspan><tspan
               x="-22.710449 -11.19405 0.32235 11.83875 23.35515 34.871552 46.387951 57.90435 69.420753 80.937149 92.453552 103.96995 115.48635 127.00275 138.51915 150.03555 161.55196 173.06834 184.58475 196.10115 207.61755 219.13396 230.65034 242.16675 253.68315 265.19955 276.71594 288.23236 299.74875 311.26514 322.78156 334.29794 345.81436 357.33075 368.84714 380.36356 391.87994 403.39636"
               y="183.9915"
               id="tspan68">地质、生态或环境测量。吾等编撰估值报告乃假设该等状况均符合要求，且于建筑期间</tspan><tspan
               x="-22.710449 -11.1174 0.47565001 12.0687 23.661751 35.254799 46.847851 58.440899 70.033951 81.626999 93.220047 104.8131 116.40615 127.9992 139.59225"
               y="199.98195"
               id="tspan70">不会产生任何非经常开支或延误。</tspan></text>
